window.bookSummaryJSON = "<p>Sheriff Hayden Duke was born on the starship <i>Pilgrim</i>, like his father, and his father before him.</p> <p>He expects to die any second.</p> <p>He's already been attacked by demonic aliens, rogue soldiers, and even the people he thought were his friends.</p> <p>He's survived. Barely.</p> <p>Outcast. Forsaken. He's entered a strange new world. A world he knows nothing about. A world he's never stepped foot on before. A world where hope has been buried beneath the claws of monsters and the boots of a tyrant.</p> <p>They took his wife. He has to find her. He has to survive. Another second. Another breath. He can never give up. He can never rest until she's back in his arms.</p> <p>They'll try to stop him. They'll try to break him. Of course, they'll try. It won't be as easy as they think. A new hope is rising in an old world.</p> <p>There's a new Sheriff in town.</p>"; 
